import React, { useEffect } from "react";
import './App.css';
import {moveCircles, headerTitle, tableOfContents} from './section_script/sectionScripts.js'

function App() {

  useEffect(() => {
    headerTitle();
    moveCircles();
    if (document.querySelector(".App-header").getBoundingClientRect().top != 0) {tableOfContents()}
  }, []);

  return (

    <div className="App">
      <header className="App-header">
        <div className="circle small"></div>
        <div className="circle small"></div>
        <div className="circle small"></div>
        <div className="circle small"></div>
        <div className="circle medium"></div>
        <div className="circle medium"></div>
        <div className="circle medium"></div>
        <div className="circle medium"></div>
        <div className="circle large"></div>
        <div className="circle large"></div>
        <div className="circle large"></div>
        <div className="circle large"></div>
        <canvas id="header-canvas"></canvas>
      </header>
      <div class="App-table-of-content">
        <canvas id="table-of-content-canvas"></canvas>
      </div>
    </div>
  );
}

export default App;
